import React from "react";
import { Link } from "react-router-dom";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import logo from "../assets/inflight-logo.png";

function Dashboard() {
  return (
    <div style={{ padding: "1.5rem", backgroundColor: "#fff" }}>
      {/* Header - Centered Logo + Title */}
      <div style={{ textAlign: "center", marginBottom: "1.5rem" }}>
        <img src={logo} alt="In-Flight Insights Logo" style={{ height: "80px", marginBottom: "0.5rem" }} />
        <h1 style={{ fontSize: "2.5rem", color: "#2c68c8", fontWeight: "bold" }}>
          ✈️ In-Flight Insights Dashboard
        </h1>
      </div>

      {/* Navigation - Right aligned */}
      <div style={{ display: "flex", justifyContent: "flex-end", marginBottom: "1.5rem", gap: "1.5rem" }}>
        <Link to="/dashboard" style={{ textDecoration: "none", color: "#2c68c8", fontWeight: "bold" }}>Dashboard</Link>
        <Link to="/sop" style={{ textDecoration: "none", color: "#2c68c8", fontWeight: "bold" }}>SOP</Link>
        <Link to="/savings" style={{ textDecoration: "none", color: "#2c68c8", fontWeight: "bold" }}>Savings</Link>
      </div>

      {/* KPIs */}
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "2rem", gap: "1rem" }}>
        {[
          { icon: "💰", title: "Cost Savings", value: "$1.2M" },
          { icon: "♻️", title: "Waste Saved", value: "210 kg" },
          { icon: "🛫", title: "Routes Analyzed", value: "350" }
        ].map((kpi, index) => (
          <div
            key={index}
            style={{
              flex: 1,
              backgroundColor: "#f5f5f5",
              padding: "2rem 1rem",
              borderRadius: "12px",
              textAlign: "center",
              boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
              border: "1px solid #ddd"
            }}
          >
            <h3 style={{ fontSize: "1.4rem", fontWeight: "700", marginBottom: "0.5rem" }}>
              {kpi.icon} {kpi.title}
            </h3>
            <p style={{ fontSize: "2.3rem", fontWeight: "bold", margin: 0 }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Chart Panels */}
      <div style={{ display: "flex", gap: "2rem", marginBottom: "2rem" }}>
        {/* Pie Chart Panel */}
        <div
          style={{
            flex: 1,
            backgroundColor: "#f7f7f7",
            border: "1px solid #ccc",
            borderRadius: "12px",
            padding: "1.5rem",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            justifyContent: "center"
          }}
        >
          <h2 style={{ fontSize: "1.5rem", fontWeight: "bold", marginBottom: "1rem", textAlign: "center" }}>
            Overall Food Consumption
          </h2>
          <div style={{ width: "80%", maxWidth: "350px" }}>
            <PieChartComponent />
          </div>
        </div>

        {/* Line Chart Panel */}
        <div
          style={{
            flex: 1,
            backgroundColor: "#f7f7f7",
            border: "1px solid #ccc",
            borderRadius: "12px",
            padding: "1.5rem"
          }}
        >
          <h2 style={{ fontSize: "1.5rem", fontWeight: "bold", textAlign: "center", marginBottom: "1rem" }}>
            Route-Specific Waste Trend
          </h2>
          <RouteLineChart />
        </div>
      </div>

      {/* Bar Chart */}
      <div style={{ marginBottom: "2rem" }}>
        <h2>Waste by Age Group</h2>
        <BarChartComponent />
      </div>

      {/* Age Group Details */}
      <div>
        <h2>Age Group Details</h2>
        <p>[Details will be shown here on click of bar chart]</p>
        <AgeGroupDetails />
      </div>
    </div>
  );
}

export default Dashboard;
